import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Common/Navbar';
import Footer from './components/Common/Footer';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import ResetPasswordPage from './pages/ResetPasswordPage'; // Placeholder
import ForgotPasswordPage from './pages/ForgotPasswordPage'; // Placeholder
import DashboardPage from './pages/DashboardPage'; // Placeholder for role-based dashboards
import NotFoundPage from './pages/NotFoundPage';
// import PrivateRoute from './utils/privateRoute'; // To be created for protected routes
import { AuthProvider } from './contexts/AuthContext'; // To be created

import './App.css';

function App() {
  return (
    <AuthProvider>
      <Router>
        <div className="App">
          <Navbar />
          <main className="container">
            <Routes>
              <Route path="/" element={<HomePage />} />
              <Route path="/login" element={<LoginPage />} />
              <Route path="/register" element={<RegisterPage />} />
              <Route path="/forgot-password" element={<ForgotPasswordPage />} />
              <Route path="/reset-password/:token" element={<ResetPasswordPage />} />
              {/* Example of a protected route, uncomment when PrivateRoute and Dashboard are ready */}
              {/* <Route path="/dashboard" element={<PrivateRoute><DashboardPage /></PrivateRoute>} /> */}
              <Route path="/dashboard" element={<DashboardPage />} /> {/* Placeholder */}
              <Route path="*" element={<NotFoundPage />} />
            </Routes>
          </main>
          <Footer />
        </div>
      </Router>
    </AuthProvider>
  );
}

export default App;
